It was an honor to join the Rutgers Center for American Women and Politics to celebrate their 50th anniversary! 

@CAWP_RU has inspired generations of women to participate in politics and provided them a foundation to run for office.

#CAWP50 @RutgersU @FConway11 @DebbieWalsh58

My bipartisan Holocaust Education and Antisemitism Lessons (HEAL) Act has moved closer to becoming law.

@SenJackyRosen and @SenatorLankford just introduced it in the Senate!

The HEAL Act will require a nationwide study on Holocaust education efforts in public schools.
